const Cart1 = ({names}) => {
    return (
        <div>
            {names.map(({name,age,phone,address}, index) => {
                return (
                    <div key={index} className="card-wrapper">
                        <div>Name : {name}</div>
                        <div>Age : { age}</div>
                        <div>Phone : { phone}</div>
                        <div>Address : {address}</div>


                    </div>
                )
            })}
        </div>
    )
}

export default Cart1
